import React, { useState, useEffect } from 'react';
import { Camera } from 'expo-camera';
import { Ionicons } from '@expo/vector-icons';
import { Col, Row, Grid } from "react-native-easy-grid";
import { View, TouchableWithoutFeedback, TouchableOpacity } from 'react-native';
import { MaterialIcons } from '@expo/vector-icons';
import styles from '../constants/styles';

export default function Toolbar({  navigation }) {
   


     function account() {
        navigation.navigate('Profile')
    }

    return (
        <Grid style={styles.bottomToolbar}>
            <Row>
                <Col style={styles.alignCenter}>
                    <TouchableOpacity onPress={() => navigation.navigate('EntryRecords')}>
                        <MaterialIcons name="today" size={30}  />
                    </TouchableOpacity>
                </Col>
                <Col style={styles.alignCenter}>
                    <TouchableOpacity onPress={() => navigation.navigate('EntryRecords')}>
                        <MaterialIcons name="description" size={30}  />
                    </TouchableOpacity>
                </Col>
                <Col style={styles.alignCenter}>
                    <TouchableOpacity onPress={() => navigation.navigate('Recommendation')}>
                        <MaterialIcons name="assistant" size={30}  />
                    </TouchableOpacity>
                </Col>
                
                <Col style={styles.alignCenter}>
                    <TouchableOpacity onPress={() => navigation.navigate('EntryRecords')}>
                        <MaterialIcons name="forum" size={30}  />
                    </TouchableOpacity>
                </Col>
                
                <Col style={styles.alignCenter}>
                    <TouchableOpacity onPress={() => navigation.navigate('Profile')}>
                        <MaterialIcons name="person" size={30}  />
                    </TouchableOpacity>
                </Col>
               
                
            </Row>
        </Grid>);
}
